  \"japanese-oceanographic-data-center-japan-land-gravity\",\n\t\"isopen\": false,\n\t\"url\":
  null,\n\t\"notes\": \"The gravity station data (4,381 records) were compiled by
  the Japanese Oceanographic Data Center. This data base was received in July 1988.
  The data are in the 'MGD77' exchange format. Principal gravity parameters include
  Free-air Anomalies and Observed gravity corrected for Eotvos, drift, and tares.
  The observed gravity values are referenced to the International Gravity Standardization
  Net 1971 (IGSN 71). The gravity anomaly computation uses the Geodetic Reference
  System 1967 (GRS 67) theoretical gravity formula. The data are randomly distributed
  within the boundaries of Japan.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
